import React, { Component } from 'react'; //import 'React' default export, and { Component } non-default export from react
// App.css was a hangover from the create-react-app, it's not really needed for this basic example
import axios from "axios";
import Button from "@material-ui/core/Button";

function App() {
  const [location, setLocation] = React.useState(null);
  const [rest, setRest] = React.useState(null);

  React.useEffect(() => {
    var location;
    /*{
      questionText: "Question",
      answer: false,
      answerKey: "",
      questionType: "radio",
      options: [{ optionText: "Option 1" }],
      open: true,
      required: false,
    };
    */
  }
  )

  function makeCall(){
  axios.get(`http://localhost:8000/results`, { params: { location: 21128 }})
    .then(res => {
      var businesses = [];
      //console.log(res.data);
      for (const business of res.data) { 
        //console.log(business.name); 
        businesses.push(business);
      }
      const result = businesses[getRandomInt(businesses.length)].name;
      setRest(result);
      })
      .catch(function(error) {
        console.log(error);
    });

    return () => {
      console.log('Will unmount');
    };
  } // Empty array means to only run once on mount.

  return (
    <div>
      <div>
        <h1>FEAT</h1>
        <input 
          type="text"
          placeholder={"eg. Baltimore, 93117"}
          onChange={(e) => {
            setLocation(e.target.value);
          }}>
          </input>
      </div>
      <div>
        <Button onClick={makeCall}>
          Start
        </Button>
      </div>
    </div>
  );
}

export default App;
